import React from 'react';
import styles from './index.module.scss';


function handleClick() {
    this.click = !this.click;
    return this.click;
}

export class GoodsShow extends React.Component {
    click = false;
    render() {
        return (
            <div>
                <div className={this.click ? styles.bigImg : styles.img} onClick={handleClick()}></div>
                <div className={styles.content}></div>
            </div>
        );
    }
}
